import React from 'react';
import '../components/css/Resume.css';

const Resume: React.FC = () => {
  return (
    <div className="resume-container">
      <h1>Resume</h1>
      <div className="resume-content">
        <p>Resume content will be added here...</p>
      </div>
    </div>
  );
};

export default Resume;
